<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Top Floor</title>
  <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&family=EB+Garamond:ital@0;1&display=swap" rel="stylesheet">
  <style>
    * { margin: 0; padding: 0; box-sizing: border-box; }
    html, body { height: 100%; overflow: hidden; }
    body { background: #000; color: #fff; font-family: 'EB Garamond', serif; }

    /* The scroll-up trick */
    .scroll-container {
      height: 100vh;
      overflow-y: scroll;
      transform: rotate(180deg);
      scrollbar-width: none;
    }
    .scroll-container::-webkit-scrollbar { display: none; }
    .content { transform: rotate(180deg); }

    .section {
      height: 100vh;
      width: 100%;
      display: flex;
      align-items: center;
      justify-content: center;
      position: relative;
    }

    /* Full-bleed cinematic photos */
    .section-photo {
      background-size: cover;
      background-position: center;
    }

    /* Act cards - centered, contained */
    .section-card {
      background: #000;
    }
    .section-card img {
      max-height: 85vh;
      max-width: 90vw;
      object-fit: contain;
    }

    /* Title - full bleed */
    .section-title img {
      width: 100%;
      height: 100%;
      object-fit: cover;
    }

    /* Finale */
    .section-finale {
      flex-direction: column;
      background: #000;
      padding: 40px;
      text-align: center;
    }
    .finale-tagline {
      font-size: clamp(1.5rem, 4vw, 2.5rem);
      font-style: italic;
      opacity: 0.7;
      margin-bottom: 15px;
      letter-spacing: 0.02em;
    }
    .finale-comps {
      font-size: 0.7rem;
      letter-spacing: 0.3em;
      text-transform: uppercase;
      opacity: 0.35;
      margin-bottom: 50px;
    }
    .btn {
      padding: 14px 28px;
      border: 1px solid rgba(255,255,255,0.15);
      background: transparent;
      color: rgba(255,255,255,0.7);
      text-decoration: none;
      font-size: 0.65rem;
      letter-spacing: 3px;
      text-transform: uppercase;
      transition: all 0.3s;
    }
    .btn:hover {
      background: rgba(255,255,255,0.05);
      border-color: rgba(255,255,255,0.3);
    }

    /* Floor counter - simple, right side */
    .floor-indicator {
      position: fixed;
      right: 30px;
      top: 50%;
      transform: translateY(-50%);
      z-index: 10;
      text-align: center;
    }
    .floor-num {
      font-family: 'Bebas Neue', sans-serif;
      font-size: 3rem;
      line-height: 1;
      opacity: 0.2;
      transition: opacity 0.3s;
    }
    .floor-label {
      font-size: 0.55rem;
      letter-spacing: 0.25em;
      text-transform: uppercase;
      opacity: 0.25;
      margin-top: 5px;
    }

    /* Hint at bottom */
    .hint {
      position: fixed;
      bottom: 30px;
      left: 50%;
      transform: translateX(-50%);
      text-align: center;
      transition: opacity 0.6s;
      z-index: 10;
    }
    .hint-arrow {
      font-size: 1.5rem;
      opacity: 0.3;
      animation: pulse 2s ease-in-out infinite;
    }
    .hint-text {
      font-size: 0.6rem;
      letter-spacing: 0.4em;
      text-transform: uppercase;
      opacity: 0.35;
      margin-top: 8px;
    }
    @keyframes pulse {
      0%, 100% { opacity: 0.3; transform: translateY(0); }
      50% { opacity: 0.5; transform: translateY(-5px); }
    }
    .hint.hidden { opacity: 0; pointer-events: none; }

    .back {
      position: fixed;
      top: 25px;
      left: 25px;
      color: rgba(255,255,255,0.4);
      text-decoration: none;
      font-size: 0.75rem;
      letter-spacing: 1px;
      z-index: 10;
      transition: color 0.2s;
    }
    .back:hover { color: rgba(255,255,255,0.7); }

    @media (max-width: 768px) {
      .floor-indicator { right: 15px; }
      .floor-num { font-size: 2rem; }
      .section-card img { max-height: 80vh; max-width: 95vw; }
    }
  </style>
</head>
<body>
  <a href="#" class="back" onclick="history.back(); return false;">←</a>

  <div class="floor-indicator">
    <div class="floor-num" id="floor-num">1</div>
    <div class="floor-label">floor</div>
  </div>

  <div class="hint" id="hint">
    <div class="hint-arrow">↑</div>
    <div class="hint-text">there's only one way to go</div>
  </div>

  <div class="scroll-container" id="container">
    <div class="content">
      <!-- FINALE (top of building) -->
      <div class="section section-finale" data-floor="★">
        <p class="finale-tagline">"It's not personal, it's just Manhattan."</p>
        <p class="finale-comps">Ripley meets Parasite</p>
        <a href="mailto:mcoynegreen@gmail.com?subject=TOP%20FLOOR" class="btn">Request Script</a>
      </div>

      <!-- ACT 4: TOP - Identity shattered -->
      <div class="section section-photo" data-floor="4" id="photo-top"></div>
      <div class="section section-card" data-floor="4" id="card-top"></div>

      <!-- ACT 3: DROP - Vertigo, the fall -->
      <div class="section section-photo" data-floor="3" id="photo-drop"></div>
      <div class="section section-card" data-floor="3" id="card-drop"></div>

      <!-- ACT 2: UP - The dream, infiltration -->
      <div class="section section-photo" data-floor="2" id="photo-up"></div>
      <div class="section section-card" data-floor="2" id="card-up"></div>

      <!-- ACT 1: BOTTOM - Humble beginnings -->
      <div class="section section-photo" data-floor="1" id="photo-bottom"></div>
      <div class="section section-card" data-floor="1" id="card-bottom"></div>

      <!-- TITLE (ground floor / lobby) -->
      <div class="section section-title" data-floor="L" id="title"></div>
    </div>
  </div>

    // Load images
    document.getElementById('title').innerHTML = `<img src="${images.title}">`;
    document.getElementById('card-bottom').innerHTML = `<img src="${images.cardBottom}">`;
    document.getElementById('photo-bottom').style.backgroundImage = `url(${images.photoBottom})`;
    document.getElementById('card-up').innerHTML = `<img src="${images.cardUp}">`;
    document.getElementById('photo-up').style.backgroundImage = `url(${images.photoUp})`;
    document.getElementById('card-drop').innerHTML = `<img src="${images.cardDrop}">`;
    document.getElementById('photo-drop').style.backgroundImage = `url(${images.photoDrop})`;
    document.getElementById('card-top').innerHTML = `<img src="${images.cardTop}">`;
    document.getElementById('photo-top').style.backgroundImage = `url(${images.photoTop})`;

    const container = document.getElementById('container');
    const floorNum = document.getElementById('floor-num');
    const hint = document.getElementById('hint');

    // Start at bottom (which is scrolled to max due to rotation)
    container.scrollTop = container.scrollHeight;

    container.addEventListener('scroll', () => {
      hint.classList.add('hidden');

      // Find current section
      const sections = document.querySelectorAll('[data-floor]');
      sections.forEach(s => {
        const rect = s.getBoundingClientRect();
        if (rect.top < window.innerHeight / 2 && rect.bottom > window.innerHeight / 2) {
          floorNum.textContent = s.dataset.floor;
        }
      });
    });
  </script>
